import React from "react";
import './../assets/scss/welcome.scss';
import { Button, Input } from 'reactstrap';
import ScreenType from '../enuns/ScreenType';
import './../assets/scss/welcome.scss'

const Welcome: React.FC = () => {
  return (
    <div className={"main"}>

      <img 
        className={"imageFromBackground"}
        src={require('./../assets/images/negocio.png')}
        alt={"decisions"}
      />
      <div>
        <img  
          className={"logoFromBackGround"}
          src={require('./../assets/images/logo.png')}
          alt={"logo"}
          style={{
            backgroundSize: 'contain',
            background: 'no-repeat',
            width:'20%',
            height: 'auto',
            alignSelf: "center",
            marginBottom: 20
          }}
          />
          

          <div className={"form shadow bg-white rounded"}>
        
        <div className={"inputs"}>
        
          <h1>Entre já!</h1>
        
          <h6 style={{
            fontSize: 14, 
            marginTop: 15, 
            marginBottom: 30
          }} 
          className="text-muted">E conheça a melhor plataforma de cotações virtuais.</h6>
          
          <Input style={{}} placeholder="E-mail"></Input>

          <Input style={{marginTop: 10}} placeholder="Senha"></Input>
        
        </div>

        <div style={{
          marginTop: 20,
        }} 
        className={"buttons"}>
          <Button color={"primary"} style={{
            width: "100%"
          }}
          onClick={() => setScreen(ScreenType.MINHASCOTACOES)}>
            Entrar
          </Button>
          <Button style={{
            width: '100%',
            marginTop: 10
          }}
            color={"light"}>
            Cadastre-se
          </Button>
          <Button style={{
            float: "right",
            fontSize: 14  
          }}
            color={"link"}>
            Esqueceu a sua senha?
          </Button>
        </div>
      </div>
      </div>
      
    </div>
  );
};

export default Welcome;
